import React from 'react';
import './menu.css';

function Menu(props){
    return(
        <div className="menu">
            <li>Primero</li>
            <li>Segundo</li>
            <li>Tercero</li>
            <li>Cuarto</li>
        </div>
    );
}

export default Menu;
